import '../css/ContactPage.css'
// import Child from './components/element'
// import Button from '@material-ui/core/Button'
// import TextField from '@material-ui/core/TextField'
import { AiFillLinkedin } from 'react-icons/ai'
import { AiOutlineMail } from 'react-icons/ai'
function ContactPage () {
  useEffect(() => {
    window.scrollTo(0, 0)
  }, [])
  return (
    <div className='mainBody'>
      <div className='contentBlock'>
        <h2>Contact:</h2>
        <div style={{display:'flex', alignItems:'center', paddingRight:'2em' }}>
            <AiOutlineMail size={32} style={{paddingRight:'2em'}} />
            <p>doyle-tom@hotmail.com
            </p>
        </div>

        <div style={{display:'flex', alignItems:'center' }}>
            <AiFillLinkedin size={32} />
            <a href='https://www.linkedin.com/in/thomas-doyle-791a45208/'>    Linked In</a>
        </div>

      </div>
    </div>
  )
}

export default ContactPage
